{'pk': 17844437519288515, 'user_id': 3539316447, 'text': 'Sin duda otra de nuestra recomendaciones para leer este verano es la novela de Raquel Taranilla, “Noche y océano”, galardonada con el Premio Biblioteca Breve 2020. Un libro rupturista, lúdico y novedoso que dibuja con asombrosa clarividencia y no poca ironía un monumental y desbordante retrato de nuestro tiempo. La autora propone un espacio en el que la literatura establece un diálogo crítico con la cultura y la sociedad. Un libro ideal tanto si te quedas en casa como si pasas unos días fuera.

@Raqueltaranilla #NocheyOcéano #PremioBibliotecaBreve2020
