{'pk': 17920505992390828, 'user_id': 3539316447, 'text': 'En estos días llenos de solidaridad, hemos descubierto que podemos ser más amables y que la amabilidad es la clave para ser más felices y convertir el mundo en un lugar mejor. Hoy os queremos dejar con el mensaje de "Felicidades, por cierto", de #GeorgeSaunders, un emotivo e inspirador libro acerca de la importancia de ser amables en nuestra vida diaria con los que nos rodean y con el mundo.

