{'pk': 17872888387572047, 'user_id': 3539316447, 'text': '📕NOVEDAD📕
Galder Reguera reconstruye en "Libro de familia" la personalidad, vida y muerte de su padre al que no llegó a conocer. La Nochevieja de 1974, la madre de Galder supo que estaba embarazada de él y ese mismo día el padre murió en un accidente de coche. El libro de Galder trata de las familias, las típicas y las atípicas y a través de documentación, fotografías y entrevistas familiares va descubriendo la vida del padre que no conoció y la fortaleza de una madre que sacó adelante a la familia en circunstancias tan difíciles. Una búsqueda que constituye en bellísimo ejercicio de autoconocimiento. .
@galderro #GalderReguera #Librodefamilia
#NovedadesEditoriales #NovedadesSeixbarral #NovedadesFebrero
.

