{'pk': 17860378303616582, 'user_id': 3539316447, 'text': 'Perfecto para los amantes de la novela nórdica, “La sombra del miedo”, de @ragnarjo, desarrollada en  la fría Islandia, la primera de la serie Islandia Negra. Su autor, escritor y abogado, ha sido durante años traductor al islandés de la novelas de Agatha Christie y uno de los creadores del Festival Internacional de Novela Negra de Reykjavik, Iceland Noir. .
.

