{'pk': 18084323254091397, 'user_id': 3539316447, 'text': 'Combinando aventuras, la fantasía y la fábula de tintes filosóficos, “Un país extraño”, la última novela de Muriel Barbery, es la lectura perfecta para esta Navidad. Un viaje al mundo de las Brumas, el país del afable y excéntrico elfo llamado Petrus. Una novela épica creada por la autora de  la aclamada “La elegancia del erizo”, un éxito internacional llevado al cine en 2009. Lectura imprescindible para estas fiestas.
.

