{'pk': 17849385343522403, 'user_id': 3539316447, 'text': '“Posiblemente sea la película más compleja a la que me he enfrentado hasta ahora. Un rodaje duro y complicado. Casi cien por cien en exteriores, en pleno verano andaluz. Queríamos hacer una película que provocara en el espectador sensación de sed, de tierra en la boca, y creo que lo hemos conseguido”, @benitozambranodirector.

Tendremos que esperar hasta el 22 de noviembre para ver esta maravillosa novela de Jesús Carrasco en la gran pantalla. ¿La reelemos?

