{'pk': 18068069140042222, 'user_id': 3539316447, 'text': '«Escribe Siri Hustvedt rodeada de máquinas de escibir. No son máquinas de escribir de verdad, solo representaciones de montones de teclas enmarcadas. Están por todas partes en su casa de Brooklyn. Su rutina es feroz. Se levanta cada mañana a las cinco y media, medita durante algo más de una hora y luego se sienta a escribir. El cerebro matutino, dice, es el más despierto. Las tardes las dedica a leer, sobre todo, ensayos relacionados con la neurociencia, disciplina que la obsesiona desde niña» Vía @el_pais

Su reciente concesión de premio Princesa de Asturias de las Letras es una gran oportunidad para recomendar y leer su obra al completo.

