{'pk': 18041412379103860, 'user_id': 3539316447, 'text': 'Una novela apasionante y adictiva sobre los mitos y la realidad, la escala moral de grises que todos manejamos entre lo bueno y lo malo, y el enigma que conecta a un recién nacido con sus antepasados.
