{'pk': 17925529174270126, 'user_id': 3539316447, 'text': 'Convencido de que toda conquista social ha requerido una revolución violenta para llegar a ser efectiva, el protagonista de esta novela, un hombre contemporáneo que se considera igualitario, decide emprender una campaña anónima de machismo extremo para provocar un cambio radical.

Poco a poco desarrollará una doble vida, como cabecilla de un grupo anónimo y violento ferozmente machista que actúa en varios niveles de la sociedad, y como pareja de la líder del movimiento feminista que le da réplica en las calles. Se convertirá en #ElAliado. ¿Preparados para este novelón?

