{'pk': 17950009168232631, 'user_id': 3539316447, 'text': 'Un joven inmigrante búlgaro regresa a su país de origen para localizar a su abuelo, quien rompió todo contacto con la familia tres años atrás. Las pistas le conducirán a un pequeño pueblo en la frontera con Turquía y a un paso de Grecia, encaramado a la mítica montaña de Strandja: un lugar envuelto en misterios paganos, en el que las cigüeñas negras anidan en robles gigantescos.

En el debut literario de #MiroslavPenkov encontrarás amor, misterio y secretos de familia. ¿Te animas a leerlo?

