{'pk': 17967572962197097, 'user_id': 3539316447, 'text': 'En 1921, #FrançoiseFrenkel, una joven apasionada por la lengua y la cultura francesas, funda la primera librería francesa de Berlín, La Maison du Livre.

Este libro es un testimonio en primera persona en el que la autora cuenta su itinerario: huyó de Alemania, se exilió en Francia pero, tras la ocupación nazi en territorio francés, tuvo que cruzar la frontera suiza de manera clandestina para encontrar su libertad.

