{'pk': 17877773233294825, 'user_id': 3539316447, 'text': "Pippi Långstrump, Ana Frank, Concha Méndez, María Guerrero, Elena Fortún, Gloria Fuertes, Carson McCullers, Patricia Highsmith o Mary Beard. Son algunas de las mujeres que han desafiado las normas y han trasladado su particular visión del mundo al debate cultural de su época.

A lo largo de la historia, muchas mujeres se han quitado el sombrero de la imposición social que las ha mantenido alejadas de una comunidad intelectual mayoritariamente masculina. Elvira Lindo retrata algunas de ellas en '30 maneras de quitarse el sombrero'. ¡Puedes leer un fragmento del libro en nuestros highlights de stories! 👆

