{'pk': 17966924398095568, 'user_id': 3539316447, 'text': "Esta es la historia de una pareja que, como tantas, se enamoró, vivió una ilusión, tuvo hijos y peleó contra todo, luchó para no rendirse, y cayó varias veces. Cuando el amor se acaba, surge la pregunta: ¿dónde se torció todo?, ¿cómo hemos acabado así?

Ya puedes encontrar 'Feliz final' de Isaac Rosa en librerías. Además, puedes leer el primer capítulo en los highlights de nuestro Instagram.

