{'pk': 17888740642270516, 'user_id': 3539316447, 'text': 'No hay criatura en la Tierra más fascinante. Tiene veneno, como una serpiente, un pico como un loro, y es capaz de introducir su cuerpo por una abertura del tamaño de una naranja. Puede cambiar de color y de forma. Puede percibir sabores con la piel. Y lo más fascinante de todo: los pulpos son inteligentes.

Montgomery no sólo nos cuenta en este libro cómo nuestro conocimiento acerca de los pulpos está cambiando, sino también una historia de amor: la suya (y por extensión la del lector, sin duda) con los cefalópodos.

