{'pk': 17970243784059807, 'user_id': 3539316447, 'text': 'Hija de un diplomático ruso y relacionada con las más altas esferas, la muerte de Sandra Mozarovski, actriz del cine del destape, nunca llegó a esclarecerse y conmocionó a la sociedad española de los años setenta.

Este dramático episodio le sirve a la narradora para dar cuenta de su propia juventud desenfrenada durante los años ochenta, de la compleja relación con su madre y de la vida de tres personajes inesperados: Camus, Wittgenstein y Pavese.

