{'pk': 17947245712080676, 'user_id': 3539316447, 'text': 'Jeroen Olyslaegers, en su visita a Barcelona el mes pasado.

#Voluntad es una lírica meditación sobre la maldad y la culpa y la novela revelación y la más premiada de 2017 en Bélgica. ¿Queréis saber un poco más del #libro? Durante la Segunda Guerra Mundial, y tras la ocupación alemana, Amberes se ve asediado por la violencia y la desconfianza. Wilfried Wils se siente poeta, pero se gana la vida como policía. Es ahí, en esa vida y época divididas entre la belleza (la de Yvette, la mujer enamorada de él; y la de Lode, un joven compañero de trabajo temerario que arriesga la vida para ayudar a los judíos) y el horror (su mentor artístico, Barbita Feroz, a quien le gustaría ver a todos los judíos aniquilados), donde Wilfried deberá escoger cuál es su bando y, por ende, su destino.

