{'pk': 17935300786154678, 'user_id': 3539316447, 'text': '«—¿Cuáles serían los rasgos más relevantes de Filek?
—Tenía un gran poder de persuasión. Él contaba que, en cierta ocasión, haciendo experimentos en su país, una probeta con agua de un río local se había inflamado espontáneamente. Si luego llegó a España era, según él, porque el agua del río Jarama tenía exactamente las mismas características químicas que ese río austriaco, lo que le había permitido desarrollar ese carburante suyo en el que entraba una proporción de agua de entre el setenta y el noventa por ciento... Que esta historia tan fantasiosa se la creyeran tantas de sus víctimas indica que era capaz de convencer a cualquiera casi de cualquier cosa.» Extracto de La Voz Digital.

