{'pk': 17964940951041888, 'user_id': 3539316447, 'text': '#Filek había aparecido en Madrid en 1931. Aunque para entonces tenía ya un largo historial delictivo a sus espaldas, no pasaba de ser un pequeño estafador. Ignacio Martínez de Pisón sigue su rastro por archivos y hemerotecas de media docena de países hasta centrarse en su etapa española.

Desde el inicio de su carreta delictiva hasta su muerte en Hamburgo en 1952, Albert von Filek fue testigo, protagonista y a veces víctima de los episodios más convulsos de la historia de Europa del pasado siglo. ¿Te animas a leerlo?
