{'pk': 17890750189224564, 'user_id': 3539316447, 'text': 'Ernesto Sabato es uno de los autores más importantes de la literatura hispánica, galardonado con el Premio Cervantes en 1984. Este agosto, relee #ElTúnel, obra esencial del autor, que Albert Camus refrendó ante la crítica mundial.

Además, en esta edición que conmemora el 70º aniversario de la obra se incluye una recopilación de textos de Sabato sobre la novela y el expediente completo de la censura en España, inédito hasta ahora. ¿Algún lector/a fiel a #ErnestoSabato en la sala?

