{'pk': 17963256022039797, 'user_id': 3539316447, 'text': 'Tal día como hoy, en 1911, nacía Ernesto Sabato en Rojas, Argentina. Y, en motivo del septuagésimo aniversario de su primera publicación, recuperamos #ElTúnel.

Esta es la historia de Juan Pablo Castel. Era pintor. Pero también asesino. Esta novela presenta en el personaje de María Iribarne la comprensión de la totalidad y el absoluto a la vez que las zonas ocultas de misterio que impulsarán a Castel a asesinarla. ¿Te apuntas a releerla?

