{'pk': 17926984105139181, 'user_id': 3539316447, 'text': '#HotelGraybar es el sobrecogedor debut de #CurtisDawkins, que desde 2005 cumple cadena perpetua por asesinato en Estados Unidos.  El título hace referencia al término con el que algunos hombres, avergonzados de admitir ante amigos y familiares que estaban en la cárcel, llamaban eufemísticamente a la prisión para hacerles creer que se encontraban fuera de la ciudad y que se alojaban en un hotel.
